function bl_change_background_mode(mode){
	switch(mode){
		case 'image':
			jQuery('.background_image').removeClass('hide');
			jQuery('.background_pattern, .background_color').addClass('hide');
		break;
		case 'pattern':
			jQuery('.background_pattern').removeClass('hide');
			jQuery('.background_color, .background_image').addClass('hide');
		break;
		case 'color':
			jQuery('.background_color').removeClass('hide');
			jQuery('.background_pattern, .background_image').addClass('hide');
		break;
	}	
}
function bl_change_icon_mode(mode){
	switch(mode){
		case 'post_format':
			jQuery('.icon_mode_post_format').removeClass('hide');
			jQuery('.icon_mode_cat').addClass('hide');
		break;
		case 'category':
			jQuery('.icon_mode_cat').removeClass('hide');
			jQuery('.icon_mode_post_format').addClass('hide');
		break;
	}	
}
function bl_change_icon_media(mode){
	switch(mode){
		case 'images':

			if(jQuery('#section-icon_mode input:checked').val() == 'post_format'){
				jQuery('.icon_mode_post_format.icon_media_image').removeClass('hide');
				jQuery('.icon_mode_post_format.icon_media_icon').addClass('hide');
			}else{
				jQuery('.icon_mode_cat.icon_media_image').removeClass('hide');
				jQuery('.icon_mode_cat.icon_media_icon').addClass('hide');
			}
		break;
		case 'icons':
			if(jQuery('#section-icon_mode input:checked').val() == 'post_format'){
				jQuery('.icon_mode_post_format.icon_media_icon').removeClass('hide');
				jQuery('.icon_mode_post_format.icon_media_image').addClass('hide');
			}else{
				jQuery('.icon_mode_cat.icon_media_icon').removeClass('hide');
				jQuery('.icon_mode_cat.icon_media_image').addClass('hide');
			}
		break;
	}	
}
function bl_change_ad_header(mode){
	switch(mode){
		case 'none':
			jQuery('.ad_header_image, .ad_header_code').addClass('hide');
		break;
		case 'image':
			jQuery('.ad_header_image').removeClass('hide');
			jQuery('.ad_header_code').addClass('hide');
		break;
		case 'html':
			jQuery('.ad_header_code').removeClass('hide');
			jQuery('.ad_header_image').addClass('hide');
		break;
	}	
}
function bl_change_ad_posts(mode){
	switch(mode){
		case 'none':
			jQuery('.ad_posts_image, .ad_posts_code, .ad_posts_options').addClass('hide');
		break;
		case 'image':
			jQuery('.ad_posts_image, .ad_posts_options').removeClass('hide');
			jQuery('.ad_posts_code').addClass('hide');
		break;
		case 'html':
			jQuery('.ad_posts_code, .ad_posts_options').removeClass('hide');
			jQuery('.ad_posts_image').addClass('hide');
		break;
	}	
}
function bl_change_ad_content(mode){
	switch(mode){
		case 'none':
			jQuery('.ad_content_image, .ad_content_code, .ad_content_options').addClass('hide');
		break;
		case 'image':
			jQuery('.ad_content_image, .ad_content_options').removeClass('hide');
			jQuery('.ad_content_code').addClass('hide');
		break;
		case 'html':
			jQuery('.ad_content_code, .ad_content_options').removeClass('hide');
			jQuery('.ad_content_image').addClass('hide');
		break;
	}	
}

