html += '</div>';


jQuery(document).ready(function() {


	if(jQuery('input[name="optionsframework_keilir_child[background_mode]"]').length > 0){
		child_or_parent = 'optionsframework_keilir_child';
	}



	jQuery('input[name="'+child_or_parent+'[enable_excerpt]"]').click(function() {
		jQuery('#section-excerpt_length').toggleClass('hide');
	});


	if( jQuery('input[name="'+child_or_parent+'[enable_excerpt]"]').is(':checked') ){
		jQuery('#section-excerpt_length').removeClass('hide');
	}



	jQuery('#section-ad_header_mode input').click(function() {
		bl_change_ad_header(jQuery(this).val());
	});
	bl_change_ad_header(jQuery('#section-ad_header_mode input:checked').val());

	jQuery('#section-ad_posts_mode input').click(function() {
		bl_change_ad_posts(jQuery(this).val());
	});
	bl_change_ad_posts(jQuery('#section-ad_posts_mode input:checked').val());

	jQuery('#section-ad_content_mode input').click(function() {
		bl_change_ad_content(jQuery(this).val());
	});
	bl_change_ad_content(jQuery('#section-ad_content_mode input:checked').val());



	jQuery('input[name="'+child_or_parent+'[background_mode]"]').click(function() {
		bl_change_background_mode(jQuery(this).val());
	});
	bl_change_background_mode(jQuery('input[name="'+child_or_parent+'[background_mode]"]:checked').val());




	jQuery('#section-icon_mode input').click(function() {
		bl_change_icon_mode(jQuery(this).val());
		bl_change_icon_media(jQuery('#section-icon_media input:checked').val());
	});
	bl_change_icon_mode(jQuery('#section-icon_mode input:checked').val());



	jQuery('#section-icon_media input').click(function() {
		bl_change_icon_media(jQuery(this).val());
	});
	bl_change_icon_media(jQuery('#section-icon_media input:checked').val());


	// append modal box with font selector
	jQuery('body').append(html);
	// add buttons
	jQuery('#section-heading_font .option').append('<a href="#TB_inline?width=400&height=550&inlineId=mbl_font_select" class="thickbox bl_edit_font button-secondary" data-option="heading_font" style="float: left; clear: left; margin: 10px 0px;" class="button-secondary">Edit</a>');
	jQuery('#section-text_font .option').append('<a href="#TB_inline?width=400&height=550&inlineId=mbl_font_select" class="thickbox bl_edit_font button-secondary" data-option="text_font" style="float: left; clear: left; margin: 10px 0px;" class="button-secondary">Edit</a>');
	jQuery('#section-menu_font .option').append('<a href="#TB_inline?width=400&height=550&inlineId=mbl_font_select" class="thickbox bl_edit_font button-secondary" data-option="menu_font" style="float: left; clear: left; margin: 10px 0px;" class="button-secondary">Edit</a>');
	jQuery('#section-brand_font .option').append('<a href="#TB_inline?width=400&height=550&inlineId=mbl_font_select" class="thickbox bl_edit_font button-secondary" data-option="brand_font" style="float: left; clear: left; margin: 10px 0px;" class="button-secondary">Edit</a>');
	// post icons edit buttons
	jQuery('.post_icon_edit .option').append('<a href="#TB_inline?width=800&height=550&inlineId=mbl_icon_select" class="thickbox bl_edit_icon button-secondary" style="float: left; clear: left; margin: 10px 0px;" class="button-secondary">Edit</a>');

	jQuery('#bl_font_select_box').change(function(){
		// clear variants & subsets
		jQuery('#bl_font_variants div').html('');
		jQuery('#bl_font_subsets div').html('');
		var font = jQuery(this).find(":selected").text();
		var index = jQuery(this).find(":selected").attr('data-index');
		jQuery('#keilir-googlefonts-css').attr('href', 'http://fonts.googleapis.com/css?family='+font.replace(' ', '+'));

		// show variants
		for (var key in bl_google_fonts[index].variants) {
		   	var variant = bl_google_fonts[index].variants[key];
		   	var checked = '';
		   	var text = '';
		   	if(variant === '400'){
		   		checked = ' checked=""';
		   		text = 'Regular'
		   	}
		   	if(variant === '400italic'){
		   		text = 'Italic'
		   	}
		   	jQuery('#bl_font_variants div').append('<input type="checkbox"'+checked+' value="'+variant+'"> <span class="bl_'+variant+'">'+((text == '') ? variant : text)+'</span><br/>');
		}

		// show subsets
		for (var key in bl_google_fonts[index].subsets) {
		   	var subset = bl_google_fonts[index].subsets[key];
		   	var checked = '';
		   	if(subset === 'latin'){
		   		checked = ' checked=""';
		   	}
		   	jQuery('#bl_font_subsets div').append('<input type="checkbox"'+checked+' value="'+subset+'"> '+subset+'<br/>');
		}
		jQuery('#bl_font_variants span, #bl_font_preview').css("font-family", "'"+font+"'");
	});

	jQuery('#bl_font_confirm').click(function(){
		var new_font = jQuery('#bl_font_select_box').find(':selected').text();
		new_font = new_font.replace(' ', '+');
		// loop variants
		if(jQuery('#bl_font_variants div input:checked').length > 0){
			new_font += ':';
			jQuery('#bl_font_variants div input:checked').each(function(index){
				var variant = jQuery(this).val();
				if(index == 0){
					new_font += variant;
				}else{
					new_font += ','+variant;
				}
			});
		}
		// loop subsets
		if(jQuery('#bl_font_subsets div input:checked').length > 0){
			new_font += '&subset=';
			jQuery('#bl_font_subsets div input:checked').each(function(index){
				if(index == 0){
					new_font += jQuery(this).val();
				}else{
					new_font += ','+jQuery(this).val();
				}
			});
		}
		jQuery('#'+font_option).val(new_font);
		tb_remove();
	});

	jQuery('.bl_edit_font').click(function(){
		font_option = jQuery(this).attr('data-option');
		active_font = jQuery('#'+font_option).val();
		var split_string = active_font.split(':');
		active_font_name = split_string[0].replace('+', ' ');
		jQuery('#bl_font_select_box').val(active_font_name).trigger('change');
		if(split_string.length > 1){
			var active_font_extras = split_string[1].split('&subset=');
			active_font_variants = active_font_extras[0].split(',');
			jQuery('#bl_font_variants div input').each(function(index){
				if(active_font_variants.indexOf(jQuery(this).val()) > -1){
					jQuery(this).prop('checked', true);
				}
			});	
		}
		if(active_font_extras.length > 1){
			active_font_subsets = active_font_extras[1].split(',');
			jQuery('#bl_font_subsets div input').each(function(index){
				if(active_font_subsets.indexOf(jQuery(this).val()) > -1){

					jQuery(this).prop('checked', true);
				}
			});					
		}
	});

	
	jQuery('.bl_edit_icon').click(function(){
		icon_input_id = jQuery(this).parent().find('.controls input').attr('id');
	});

	jQuery('.bl_icon_container a').click(function(){
		jQuery('#'+icon_input_id).val(jQuery(this).find('i').attr('class'));
		tb_remove();
	});



});